import React from "react";

function NavBar(props) {
  return (
    <nav className="navbar bg-light">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">
          {props.totalCounter}
        </a>
      </div>
    </nav>
  );
}

export default NavBar;
